import React, { useState } from 'react';
import './App.css';

const App = () => {

  const [randomState, setRandomState] = useState('this is a state string')
  setRandomState.useState("I changed the state")
  console.log(randomState)
  return (
    <div className="App">
      <h1>Aliantra</h1>
    </div>
  );
}

export default App;
